import React from 'react'
import classes from './styles/Projects.module.css'
import Cards from './Cards'
const Projects=[{
    name:'XXX',
},
{
    name:'YYY',
},
{
    name:'ZZZ',
},
];
const Wheels = () => {
    return (
        <>
            <div className={classes.Wheels}>hi</div> 
            {Projects.map((data,index)=><Cards><h1>{data.name}</h1></Cards>)}
        </>
    )
}

export default Wheels
